import React from 'react';
import * as ReactBootStrap from 'react-bootstrap';
import { MenuItems } from './MenuItems';

const Navbar = () => {
    return (
        <div className="navbar-bg">
            <ReactBootStrap.Navbar collapseOnSelect expand="md" bg="transparent" variant="dark" className="navbar">
                <ReactBootStrap.Navbar.Brand href="#home"><strong>Avatu</strong></ReactBootStrap.Navbar.Brand>
                <ReactBootStrap.Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <ReactBootStrap.Navbar.Collapse id="responsive-navbar-nav">
                    <ReactBootStrap.Nav className="ml-auto">
                        {MenuItems.map((item, index) => {
                            return (
                                <ReactBootStrap.Nav.Link href={item.title}>Features</ReactBootStrap.Nav.Link>
                            )
                        })}
                    </ReactBootStrap.Nav>
                </ReactBootStrap.Navbar.Collapse>
            </ReactBootStrap.Navbar>
        </div>
    )
}
export default Navbar
